import React from "react";
import styled from "styled-components";
import NavbarComp from "../UI/NavbarComp";

const Landing = () => {
  return (
    <Container>
      <NavbarComp />
      <h2>Sam's Auto</h2>
    </Container>
  );
};

export default Landing;

const Container = styled.div`
  width: 100%;
  height: 100vh;
  background-color: #151515;
  font-family: "Quicksand", sans-serif;
  color: white;
`;
